import { Card } from "react-bootstrap";

const SingleBook = ({ book }) => {
  return (
    <Card style={{}}>
      <Card.Img
        className="img-fluid"
        style={{
          objectFit: "cover",
        }}
        variant="top"
        src={book.img}
      />
      <Card.Body>
        <Card.Title className="text-truncate">{book.title}</Card.Title>
        {/* <Button variant="primary"></Button> */}
      </Card.Body>
    </Card>
  );
};

export default SingleBook;
